import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import { Container } from "react-bootstrap";
import Slidebar from "./Slidebar";
import Permission from "./Permisson";

function SubElement() {
  return (

      <Row >
        <Col>
          <Slidebar />
        </Col>
        <Col>
          <Permission />
        </Col>
      </Row>
  );
}
export default SubElement;
